import { Link } from "react-router-dom";

export default function Account() {
  return (
      <center>
      <button>
        <Link to="/myaccount/personalinfo/">
          Personal Info
        </Link>
      </button>
      <br />
      <button>
        Data & Privacy
      </button>
      </center>
  );
}
